          "slug": "_3-情况3-如果一个函数中有this-这个函数中包含多个对象-尽管这个函数是被最外层的对象所调用-this指向的也只是它上一级的对象。"
        },
        {
          "level": 3,
          "title": "④ 特殊情况：this永远指向的是最后调用它的对象，也就是看它执行的时候是谁调用的",
