        },
        {
          "level": 3,
          "title": "⑤ 构造函数版this：首先new关键字会创建一个空的对象，然后会自动调用一个函数方法，将this指向这个空对象，这样的话函数内部的this就会被这个空的对象替代。",
          "slug": "_5-构造函数版this-首先new关键字会创建一个空的对象-然后会自动调用一个函数方法-将this指向这个空对象-这样的话函数内部的this就会被这个空的对象替代。"
        },
        {
          "level": 3,
          "title": "⑥ 箭头函数：箭头函数本身没有this和arguments，默认指向定义它时，所处上下文的函数对象的this指向。即ES6箭头函数里this的指向就是上下文里函数对象this指向，偶尔没有上下文对象，this就指向window。",
